10:25 AM Defendant Nicole K Holder in court, in custody.  Attorney Jeffrey W. Jensen Jr. in court for Nicole K Holder.  Prosecuting attorney Andrew Nesheim in court for the State of Wisconsin. 
Case called for plea and sentencing.  Defendant enters a guilty plea to Count 2.  Court finds defendant guilty.   Counts 1 and 3 are dismissed and read in.  Case 22CM1056 is dismissed and read in to 21CM1800 and 22CM1359.
Recommendations by the State.  Recommendations by the Defense.  Statement by defendant.

The Court Orders the Following:

Count 2:
Withheld sentence

Term of Probation: 2 Years.  Court would consider early termination of probation after 18 months if all conditions have been met.
Conditions of Probation:
-	Follow through with any treatment and/or counseling recommended by Agent;
-	No contact with Victim A in 21CM1800.
-	AODA Assessment and follow through with any treatment recommended;
-	Absolute Sobriety; 
-	Random U.A.'s;
-	No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
-	Maintain/Obtain full time employment (35 hours per week);
-	Complete 20 hours of Community Service within the first 12 months of probation;
-	No new law violations;

COSTS:  $ 243.00

DNA Surcharge: $ 200.00

DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 

Total costs/fine/forfeiture:  to be paid as a condition of probation. Failure to pay;  will result in a civil judgment.  As an alternative to payment the defendant may complete community service as approved by the Agent.  Each hour of community service to equal $25.00 towards financial obligations.
